import olympic from './olympic.png';
import { useState } from "react";

const Bodies = () => {
    const [image, setImage] = useState(foot);
    setTimeout(() => {
        if(image===foot) {
            setImage(plympic);
        } else {
            setImage(foot);
        }
        return (
            <p><img src={image} height="900" width="1200" alt=""/></p>
        );
    }, 5000);
};

export default Bodies;
